import React from "react";

const ActorImage = ({ imgUrl }) => {
  return (
    <div className="center ma">
      <div className='absolute mt2'>
        <img alt="actor" src={imgUrl} width='500px' height='auto' className='grow'/>
      </div>
    </div>
  );
};


export default ActorImage;
